import React from "react";


function Staff({id, firstName, lastName, email, gender, salary, taxes }) {


    return (
        <li>
            ID: {id}, Name: {firstName} {lastName}, Email: {email}, Gender: {gender}, Salary: {salary}, Taxes: {taxes}
        </li>
    );

}


export {Staff};
